import { Component, OnInit } from '@angular/core';

interface Code {
    code: string
}

@Component({
    selector: 'layout-button',
    templateUrl: './layout-button.html'
})
export class layoutButton {
    codes!: Code[];

    selectedCodes!: Code[];

    ngOnInit() {
        this.codes = [
            { codes: '12556' },
            { codes: '61566' },
            { codes: '78266' },
            { codes: '97223' },
            { codes: '23657' }
        ];
    }

    cars = [
        { label: 'BMW', value: 'bmw' },
        { label: 'Audi', value: 'audi' },
        { label: 'Mercedes', value: 'mercedes' },
    ];

    selectedCars: string[] = [];
}
